import './App.css';


const phoneData = [
  {name: "I Phone x ", price: 10000000, diskon: 20},
  {name: "I Phone xr ", price: 8000000, diskon: 20},
  {name: "I Phone z ", price: 7000000, diskon: 20},
  {name: "I Phone y ", price: 98000000, diskon: 20},
] 



function Product ({name, price, diskon = 0 }){
    return (
        <div>
            <h2>{name}</h2>
            <p>
                <s>Rp {price}</s> ({diskon} %) <s/>
            </p>

            <p>
                <b>Rp {parseInt(price) - parseInt(price) * (parseInt(diskon) / 100)}</b>
            </p>
            <hr />
        </div>
    )
}



function App() {
  return (
    <div className="App">

   {phoneData.map((phone,id) =>{
    <Product key={id}
      name={phone.name}
      price={phone.price}
      diskon={phone.diskon}

    ></Product>
   })}

    </div>
  );
}

export default App;
